import React from "react";

export default function TextArea() {
  return (
    <div className="container">
      <label for="exampleFormControlTextarea1" class="form-label">
        Example textarea
      </label>
      <textarea
        class="form-control"
        id="exampleFormControlTextarea1"
        rows="3"
      ></textarea>
    </div>
  );
}
